import React from "react";
import Header from "./components/Header";
import Hero from "./components/Hero";
import Services from "./components/Services";
import About from "./components/About";
import Contact from "./components/Contact";
import Footer from "./components/Footer";

const App: React.FC = () => {
  return (
    <div className="bg-gradient-to-br from-[#0f172a] via-[#1e293b] to-[#334155] text-white min-h-screen overflow-x-hidden">
      <div className="absolute top-0 left-0 w-full h-full opacity-10 z-0 bg-[url('/images/pattern.jpg')] bg-cover bg-no-repeat" />
      <div className="relative z-10">
        <Header />
        <Hero />
        <Services />
        <About />
        <Contact />
        <Footer />
      </div>
    </div>
  );
};

export default App;
